$(function(){$("time.timeago").timeago();var t=$(".author");t.each(function(e){elm=$(t[e]),url=elm.data("author"),$.ajax({method:"GET",url:url,context:elm,success:function(t){var e=t.username;this.html("by "+e)}})});var e=$(".community");e.each(function(t){elm=$(e[t]),url=elm.data("community"),$.ajax({method:"GET",url:url,context:elm,success:function(t){var e=t.title;this.html(" ("+e+")")}})}),$("#deleteModal").on("shown.bs.modal",function(t){t.preventDefault()}),$(".delete").click(function(t){$("#deleteButton").data("action",$(this).data("href")),t.preventDefault()}),$("#deleteButton").click(function(t){$.ajax({method:"DELETE",url:$(this).data("action")})})});
